import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'bookingFilter'
})
export class BookingFilterPipe implements PipeTransform {

  transform(bookings: any[]): any[] {
    if (!bookings) return [];
    return bookings.filter(
      booking => booking.status !== 'Cancelled'
    );
  }
}
